        # Function to parse date string
        def parse_date(date_str):
            # Format: "YY-MM-DD"
            parts = date_str.split('-')
            year = 2000 + int(parts[0]) if int(parts[0]) < 60 else 1900 + int(parts[0])
            month = int(parts[1])
            day = int(parts[2])
            return datetime(year, month, day).date()

        # Function to parse datetime string
        def parse_datetime(datetime_str):
            # Format: "YYYY. M. D 오후 H:MM:SS"
            datetime_str = datetime_str.replace('오후', 'PM').replace('오전', 'AM')
            # Parse with specific format
            parts = datetime_str.replace('.', '').split()
            year = int(parts[0])
            month = int(parts[1])
            day = int(parts[2])
            time_parts = parts[4].split(':')
            hour = int(time_parts[0])
            minute = int(time_parts[1])

            # Adjust hour for PM
            if parts[3] == 'PM' and hour != 12:
                hour += 12
            elif parts[3] == 'AM' and hour == 12:
                hour = 0

            return datetime(year, month, day, hour, minute)

        with transaction.atomic():
            # Delete all existing data
            self.stdout.write('Deleting existing EvaluationNo data...')
            EvaluationNo.objects.all().delete()

            # Load new data
            self.stdout.write('Loading new EvaluationNo data...')
            for row in data:
                no, date_start, date_end, date_notice, f_average_all, f_average_excel, time_excel, time_weak = row

                evaluation_no = EvaluationNo(
                    no=no,
                    dateStart=parse_date(date_start),
                    dateEnd=parse_date(date_end),
                    dateNotice=parse_date(date_notice) if date_notice else None,
                    fAverageAll=f_average_all,
                    fAverageExcel=f_average_excel,
                    timeExcel=parse_datetime(time_excel) if time_excel else None,
                    timeWeak=parse_datetime(time_weak) if time_weak else None,
                )
                evaluation_no.save()

            self.stdout.write(self.style.SUCCESS(f'Successfully loaded {len(data)} EvaluationNo records'))